#Creating a main application functions
class Application_Functions(File_Functions):
    def __init__(self):
        self.document = Document('docxteste.docx')
        self.cnv = None
        self.pages=[]
        self.contents=[]
    def base64_images(self):
        self.ecosol_logo=""
    
    def gets_entry_values(self):
        self.document_name = self.document_name_entry.get()
        self.client_name = self.document_client_entry.get()
        # print(self.document_name)
        print(self.client_name)
        # self.set_client_name(self.document_name)
        # print(self.client_name)

    def mm2p(mm: int):
        return mm/0.352777

    def file_reader(self):
        self.file=open(self.document_name+'.pdf','rb')
        self.cnv = canvas.Canvas(self.document_name+'.pdf')
        self.file_content = ppdf.PdfFileReader(self.file)
        
        print('pdf content readed')

        for i in range(self.file_content.numPages):
            self.pages.append(self.file_content.getPage[i])
        
        print('pdf pages getted')

        for i in range(self.file_content.numPages):
            self.contents.append(self.pages[i].extractText())

        print(self.contents)
        print('pdf pages contents getted')

    def file_generate(self):
        for paragraph in self.document.paragraphs:
            if '[document title]' in paragraph.text:
                paragraph.text =  paragraph.text.replace('[document title]',self.client_name)
        self.document.save(self.document_name+'.docx')
        convert(self.document_name+'.docx',self.document_name+'.pdf')
        os.remove(self.document_name+'.docx')
    
#building the application
class Application(Application_Functions):
    def __init__(self):
        self.root=Tk()
        self.base64_images()
        self.screen()
        self.window_buttons()
        self.frame_logo()
        self.main_frame()
        self.pages()
        self.widgets_page1()
        self.labels_frame_logo()
        self.root.mainloop()
    #set main window definitions
    def screen(self):
        self.root.title('ECOSOL - PDF AUTO GENERATE')
        self.root.geometry("1000x700")
        self.root.resizable(True,True)
        #self.root.maxsize(width=,height)
        #self.root.minsize(width=,height=)
    #set first frame definitions
    def frame_logo(self):
        self.fr_logo=Frame(
            self.root,
            bd=4,
        )
        self.fr_logo.place(
            relx=0.3,
            rely=0.01,
            relwidth=0.4,
            relheight=0.2
        )
    #setting main frame definitions
    def main_frame(self):
        self.main_fr=Frame(
            self.root,
            # bg='white',
            bd=4,
            highlightbackground='black',
            highlightthickness=0.5
        )
        self.main_fr.place(
            relx=0.01,
            rely=0.2,
            relwidth=0.98,
            relheight=0.725
        )
    #setting notebook in main frame
    def pages(self):
        self.notebook = ttk.Notebook(self.main_fr)
        self.page1 = Frame(self.notebook)
        self.page2 = Frame(self.notebook)

        self.page1.configure(background='lightgray')
        self.page2.configure(background='lightgray')

        self.notebook.add(self.page1,text='main settings')
        self.notebook.add(self.page2, text='seccond settings')

        self.notebook.place(
            relx=0,
            rely=0,
            relwidth=1,
            relheight=1
        )
    #setting logo
    def labels_frame_logo(self):
        self.ecosol_img = PhotoImage(data=base64.b64decode(self.ecosol_logo))
        self.ecosol_img.subsample(1,-1)
        self.ecosol_label_img = Label(self.fr_logo, image=self.ecosol_img)
        self.ecosol_label_img.place(
            relx=0.0,
            rely=0.0,
            relheight=1,
            relwidth=1
        )
    def widgets_page1(self):
        #creating page1 labels
        self.document_name_label = Label(
            self.page1,
            text="Document Name:",
            bg = 'lightgray',
        )
        self.document_client_label = Label(
            self.page1,
            text="Client Name:",
            bg = "lightgray"
        )
        
        #locating page1 labels
        self.document_name_label.place(
            relx=0,
            rely=0,
            relwidth=0.12,
            relheight=0.1
        )
        self.document_client_label.place(
            relx=0,
            rely=0.11,
            relwidth=0.1,
            relheight=0.1
        )
        
        #creating page1 entrys
        self.document_name_entry = Entry(self.page1)
        self.document_name_entry.place(
            relx=0.01,
            rely=0.071,
            relwidth=0.15,
            relheight=0.06
        )
        
        self.document_client_entry = Entry(self.page1)
        self.document_client_entry.place(
            relx=0.01,
            rely=0.181,
            relwidth=0.15,
            relheight=0.06
        )
    def window_buttons(self):
        self.generate_pdf_button = Button(
            self.root,
            text = "Gerar PDF",
            command = self.gets_entry_values
        )
        self.generate_pdf_button.place(
            # relx=0.87,
            relx=0.5,
            rely=0.94,
            relwidth=0.1,
            relheight=0.05
        ) 

Application()